import React, {useEffect} from 'react';
import './App.css';
import anime from "animejs";

function App() {

    useEffect(() => {
        const $card = document.querySelector(".card");
        const $style = document.querySelector(".hover");

        const handleMouseMove = (e) => {
            const l = e.offsetX;
            const t = e.offsetY;
            const h = $card.offsetHeight;
            const w = $card.offsetWidth;
            const lp = Math.abs(Math.floor(100 / w * l) - 100);
            const tp = Math.abs(Math.floor(100 / h * t) - 100);
            const bg = `background-position: ${lp}% ${tp}%;`;
            const style = `.card.active:before { ${bg} }`;
            $card.classList.add("active");
            $style.innerHTML = style;
        };

        const handleMouseOut = () => {
            $card.classList.remove("active");
        };

        const resetTransform = (el, perspective = 800) => {
            el.style.transform = `translate3d(0%, 0%, -${perspective / 2}px) rotateX(0deg) rotateY(0deg)`;
        };

        const onMove = (ev, el) => {
            const {pageX, pageY} = ev;
            const {offsetWidth, offsetHeight} = el;
            const {left, top} = el.getBoundingClientRect();

            const cardX = left + offsetWidth / 2;
            const cardY = top + offsetHeight / 2;

            const angle = 10;
            const rotX = (cardY - pageY) / angle;
            const rotY = (cardX - pageX) / -angle;

            el.style.transform = `translate3d(0%, 0%, 0) rotateX(${rotX}deg) rotateY(${rotY}deg)`;
        };

        const perspective = parseFloat(getComputedStyle($card.parentElement).getPropertyValue("perspective")) || 800;

        const onCardMove = (ev) => onMove(ev, ev.currentTarget);
        const onHover = (ev) => ev.currentTarget.addEventListener("mousemove", onCardMove);
        const onOut = (ev) => {
            resetTransform(ev.currentTarget, perspective);
            ev.currentTarget.removeEventListener("mousemove", onCardMove);
        };

        $card.addEventListener("mousemove", handleMouseMove);
        $card.addEventListener("mouseout", handleMouseOut);
        $card.addEventListener("mouseover", onHover);
        $card.addEventListener("mouseout", onOut);

        return () => {
            $card.removeEventListener("mousemove", handleMouseMove);
            $card.removeEventListener("mouseout", handleMouseOut);
            $card.removeEventListener("mouseover", onHover);
            $card.removeEventListener("mouseout", onOut);
        };
    }, []);

    let isIn = true;

    const cardClick = () => {
        if (isIn === true) {

            anime({
                targets: '.btn1',
                translateX: -620,
                translateY: 140,
            });
            anime({
                targets: '.btn2',
                translateX: -400,
                translateY: 435,
                delay: 100, // 0.2초(200밀리초) 지연

            });
            anime({
                targets: '.btn3',
                translateX: -50,
                translateY: 550,
                delay: 200, // 0.2초(200밀리초) 지연

            });
            anime({
                targets: '.btn4',
                translateX: 300,
                translateY: 435,
                delay: 300, // 0.2초(200밀리초) 지연
            });
            anime({
                targets: '.btn5',
                translateX: 520,
                translateY: 140,
                delay: 400, // 0.2초(200밀리초) 지연
            });
            isIn = false

        } else {
            anime({

                targets: '.btn1',
                translateX: -50,
                translateY: 0,
                easing: 'easeInOutQuart', // 이징을 easeInOutQuart로 설정
            });
            anime({
                targets: '.btn2',
                translateX: -50,
                translateY: 0,
                easing: 'easeInOutQuart', // 이징을 easeInOutQuart로 설정


            });
            anime({
                targets: '.btn3',
                translateX: -50,
                translateY: 0,
                easing: 'easeInOutQuart', // 이징을 easeInOutQuart로 설정


            });
            anime({
                targets: '.btn4',
                translateX: -50,
                translateY: 0,
                easing: 'easeInOutQuart', // 이징을 easeInOutQuart로 설정

            });
            anime({
                targets: '.btn5',
                translateX: -50,
                translateY: 0,
                easing: 'easeInOutQuart', // 이징을 easeInOutQuart로 설정

            });
            isIn = true

        }


    }


    return (
        <div className="App">
            <div id="app">
                <div className="card charizard" onClick={cardClick}></div>
                <style className="hover"></style>
                <div className="btn-shine">DOTORY</div>
                <div className={"btn1"}></div>
                <div className={"btn2"}></div>
                <div className={"btn3"}></div>
                <div className={"btn4"}></div>
                {/*<div className={"btn5"} ></div>*/}
                <a className="btn5">
                    <svg viewBox="0 0 496 512" height="1em" fill="#fff" xmlns="http://www.w3.org/2000/svg">
                        <path
